import React from 'react'
import { Document, Page } from 'react-pdf/dist/esm/entry.webpack';
import PDF from "../assets/CV.pdf"



const CVPDF = () => {

  return (
    <div>
      <Document file={PDF} >
        <Page pageNumber={1} />
      </Document>
    </div>
  )
}

export default CVPDF
